            series: seriesData.map(series => ({
                ...series,
                zoneAxis: 'x',
                zones: [
                    {
                        value: series.data.find(p => p.isForecast).x,
                        dashStyle: 'Solid',
                        color: series.color
                    },
                    {
                        dashStyle: 'Dash',
                        color: series.color
                    }
                ]
            }))
        });
    </script>
</body>
</html>
